INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5902121000165', 'Lody śmietankowe w czekoladzie', 'Odtworzone _mleko_ odtłuszczone, czekolada 32% (cukier, tłuszcz kakaowy, miazga kakaowa, bezwodny tłuszcz _mleczny_, odtłuszczone _mleko_ w proszku, serwatka w proszku _mleko_), olej kokosowy, pełne _mleko_ w proszku, emulgatory: lecytyny (z _soi_, E476; aromat. Masa kakaowa minimum 48%), cukier, olej kokosowy, odtłuszczone _mleko_ w proszku, glukoza, emulgator: E471, stabilizatory: E410, E412, śmietanka w proszku 0,2%; barwnik: E160b, kawa naturalna. Produkt może zawierać nasiona sezamu, orzeszki arachidowe i orzechy.', 'https://static.openfoodfacts.org/images/products/590/212/100/0165/front_pl.4.400.jpg', '21', '15', '29', '29', '', '3.9', '0.17', '0.0669291338582677', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5902121019136', 'Lody waniliowe w mlecznej czekoladzie z migdałami', 'Odtworzone _mleko_ odtłuszczone, mleczna czekolada 37% (cukier, tłuszcz kakaowy, odtłuszczone _mleko_ w proszku, miazga kakaowa, bezwodny tłuszcz _mleczny_, serwatka w proszku (_mleko_), olej kokosowy, emulgatory: lecytyny (z _soi_), E476, aromat. Masa kakaowa minimum 33%), cukier, olej kokosowy, migdał krojony 8%, odtłuszczone _mleko_ w proszku, syrop glukozowy, emulgator: E471, stabilizatory: E410, E466, E407; barwnik: karoteny, naturalny aromat waniliowy z innymi naturalnymi aromatami, wanilia w proszku 0,01%. Produkt może zawierać nasiona sezamu, orzeszki arachidowe i inne orzechy. Najlepiej spożyć przed końcem: patrz nadruk z przodu opakowania. Temperatura przechowywania nie wyższa niż-18°C. Nie zamrażać powtórnie. Czekolada oprócz tłuszczu kakaowego zawiera tłuszcze roślinne.', 'https://static.openfoodfacts.org/images/products/590/212/101/9136/front_pl.4.400.jpg', '26', '16', '31', '29', '', '5.7', '0.5', '0.196850393700787', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5902121020859', 'Lody bakaliowe w rożku waflowym i orzechami arachidowymi karmelizowanymi w czubku wafla', 'Odtworzone _mleko_ odtłuszczone, rożek waflowy 20% (mąka _pszenna_, cukier, emulgator: lecytyny (z _soi_), skrobia ziemniaczana, tłuszcz palmowy, sól), _śmietanka_ 11,5%, polewa do impregnacji rożka (tłuszcz roślinny: kokosowy, palmowy, słonecznikowy, shea, rzepakowy - w zmiennych proporcjach, cukier, kakao w proszku o obniżonej zawartości tłuszczu (11%), emulgator: lecytyny (z _soi_), cukier, _masło_, rodzynki 5%, _orzechy włoskie_ kandyzowane 5% (_orzech włoski_, cukier, syrop glukozowy), _orzeszki arachidowe_ karmelizowane 2,9% (_orzeszki arachidowe_ 75%, cukier), odtłuszczone _mleko_ w proszku, emulgator: mono - i diglicerydy kwasów tłuszczowych, stabilizatory: mączka chleba świętojańskiego, guma celulozowa, karagen; aromat, barwnik: annato. Produkt może zawierać nasiona sezamu i inne orzechy.', 'https://static.openfoodfacts.org/images/products/590/212/102/0859/front_pl.4.400.jpg', '18', '10', '40', '27', '', '4.8', '0.19', '0.0748031496062992', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5902121022204', 'Lody śmietankowe z ciasteczkami', 'Odtworzone _mleko_ odtłuszczone, _śmietanka_ 17%, ciasteczka 16% [mąka _pszenna_, cukier, tłuszcze roślinne (palmowy, rzepakowy), kakao w proszku o obniżonej zawartości tłuszczu, mieszanka słodowa (syrop glukozowy, syrop _jęczmienny_, ekstrakt słodowy), substancje spulchniające: E500ii, E334; sól, aromat], cukier, _masło_, syrop glukozowy, odtłuszczone _mleko_ w proszku, glukoza, emulgator: mono - i diglicerydy kwasów tłuszczowych, stabilizatory: guma celulozowa, mączka chleba świętojańskiego, karagen; aromat, barwnik: karoteny. Produkt może zawierać nasiona sezamu, orzeszki arachidowe i orzechy. Temperatura przechowywania nie wyższa niż - 18°C. Nie zamrażać powtórnie.', 'https://static.openfoodfacts.org/images/products/590/212/102/2204/front_pl.4.400.jpg', '15', '9.6', '32', '24', '', '3.8', '0.2', '0.078740157480315', '', '1');

