VALUES ('5902431561639', 'Kruche ciasteczka z orzechami bez dodatku cukru', 'Kruche ciasteczka z orzechami bez dodatku cukru. Kruche ciasteczka z płatkami, kroplami czekolady bezcukrowej i orzechami bez dodatku cukru. Składniki: maka _pszenna_, tłuszcz roślinny (palmowy), substancja słodząca: maltitol; 6% orzechy (_orzechy laskowe_, _orzeszki arachidowe_, _migdały_), 5% płatki kukurydziane i owsiane, 2,5% czekolada bezcukrowa [substancja słodząca: maltitol; miazga kakaowa, emulgator: lecytyny (z _soi_), kakao w proszku o obniżonej zawartości tłuszczu, naturalny aromat waniliowy], odtłuszczone _mleko_ w proszku, serwatka (z _mleka_) w proszku, masa _jajowa_ pasteryzowana, emulgator: lecytyny (z _soi_); skrobia ziemniaczana, kakao w proszku o obniżonej zawartości tłuszczu, substancje spulchniające: węglany sodu, węglany amonu; sól, aromat. Zawiera gluten, mleko, jaja, soję, orzechy laskowe, orzeszki arachidowe i migdał. Może zawierać nasiona sezamu. Bez dodatku cukrów. Zawiera naturalnie występujące cukry. Produkt zawiera substancję słodzącą (maltitol). Spożywanie w nadmiernych ilościach może powodować efekt przeczyszczający.', 'https://static.openfoodfacts.org/images/products/590/243/156/1639/front_pl.4.400.jpg', '29', '10', '36', '1.2', '', '6.8', '0.42', '0.165354330708661', '', '1');

