INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('5902448207469', 'Xtreme WheyBolic', '(FR) ITREME WHEYBOLIC. Avec édulcorants. Produit à haute teneur protéique sous forme de poudre pour la préparation d\'une délicieuse boisson, à base de concentré de protéines de lactosérum avec une teneur en protéines de 80%. Produit recommandé pour les personnes Dhysiquement actives avec un besoin accru en protéines. Les protéines contribuent à augmenter et à maintenir la masse musculaire. ln rédients: 87%* Concentré protéique de lactosérum (de lait), caca03, arômes, concentré de racine de betteravè45S, colorant (E160a)71, épaississant (gomme xanthane), correcteur d\'acidité (acide citrique)2A\'6\'7, sep, édulcorants (sucralose, acésulfame K). Mode d\'emploi: Mélangez 1 cuillere de poudre (30 g) dans 200 ml d\'eau ou de lait. Boire 1 portion avant et immédiatement après l\'entraînement. Avertissement: Ne pas utiliser si vous êtes allergique à l\'un des composés de produits. Ne pas utiliser si vous êtes enceinte ou allaitante. Une alimentation variée et équilibrée et un mode de vie sain sont recommandés. Peut contenir du blé (qluten), des œufs du soja. Tenir hors de portée des enfants. Conservez dans un endroit sec et frais. Protégez de la lumière directe du soleil. Saveurs: Vanillé, Fraise, Chocolat), Framboisé, Cassis5, Chocolat blanc-cannebergé, Gâteau au fromage au citron7.', 'https://static.openfoodfacts.org/images/products/590/244/820/7469/front_fr.4.400.jpg', '6.8', '4.7', '4', '4', '', '70', '0.4', '0.15748031496063', '', '1');

